import React from 'react'

export default function Item( { title, text, link } ) {
  return (
    <a href={link} target='_blank'>
        <div className="item-container">
            <p className="item-title">{title}</p>
            <p className="item-text">{text}</p>
        </div>
    </a>

  )
}
